	const token = useLoaderData();
	useEffect(() => {
		if (!token) {
			return;
		}

		setTimeout
	}, [token]);
	return (
		<>
			<MainNavigation />
			<main>
				<Outlet />
			</main>
		</>
	);
}

export default RootLayout;
